sys_variable_value.value:
(function execute(inputs, outputs) {
    // Get Connection Parameters
    var gr = new GlideRecord('x_caci_cisco_ise_integration_settings');
    gr.addQuery();
    gr.setLimit(1);
    gr.query();
    gr.next();
    //
    var password = gr.pxgrid_secret;
    var decrypted = password.getDecryptedValue();

    var encodedAuth = gs.base64Encode(gr.pxgrid_account_name + ':' + decrypted);
    var basic_auth_str = "Basic " + encodedAuth;

    outputs.pxgrid_auth = basic_auth_str;
    outputs.pxgrid_url = ('https://' + gr.pxgrid_node + ':' + gr.pxgrid_port + '/');
    outputs.mid = gr.mid_server;

    gs.debug('ISE APP - Data Source Action - Connection Params - basic auth: ' + gr.pxgrid_account_name + ':' + decrypted + ' | pxgrid_url: https://' + gr.pxgrid_node + ':' + gr.pxgrid_port + '/');

    // Add Last Sync Time to Integration Settings Config
    // Parse Last Run Time and convert to ISE format(ISO) to be used in the request
    var ls = new GlideDateTime(gr.last_sync);
    var nv = ls.getNumericValue();
    var last_sync = new Date(nv).toISOString();
    gs.info('ISE APP - Data Source Action - Running Data Import - updating last_sync: ' + last_sync);
    gr.last_sync = new GlideDateTime();
    gr.update();

    // Parse Last Import Time and convert to ISE format(ISO) to be used in the request
    outputs.last_sync = last_sync;

})(inputs, outputs);

